function App() {
  return 
    <div>
      //localhost:3000
      <Route path=''>
        <AllMeetupsPage />
      </Route>
      <Route path='new-meetup'>
      <NewMeetupPage />
    </Route>
    <Route path='favorites'>
        <FavoritesPage />
      </Route>
    </div>;
}

export default App;
